(55, 1, '2015-02-09 12:44:31', '2015-02-09 05:44:31', '<p>Selama Abad pertengahan, rumah sakit juga melayani banyak fungsi di luar rumah sakit yang kita kenal pada zaman sekarang, misalnya sebagai penampungan orang miskin atau persinggahan musafir. Istilah hospital (rumah sakit) berasal dari kata Latin, hospes (tuan rumah), yang juga menjadi akar kata hotel dan hospitality (keramahan).</p>\r\n<p>Beberapa pasien bisa hanya datang untuk diagnosis atau terapi ringan untuk kemudian meminta perawatan jalan, atau bisa pula meminta rawat inap dalam hitungan hari, minggu, atau bulan. Rumah sakit dibedakan dari institusi kesehatan lain dari kemampuannya memberikan diagnosa dan perawatan medis secara menyeluruh kepada pasien.</p>\r\n<p>Rumahsakit menurut WHO Expert Committee On Organization Of Medical Care: is an integral part of social and medical organization, the function of which is to provide for the population complete health care, both curative and preventive and whose out patient service reach out to the family and its home environment; the hospital is also a centre for the training of health workers and for biosocial research</p>', 'Web Dev', 'Selama Abad pertengahan, rumah sakit juga melayani banyak fungsi di luar rumah sakit yang kita kenal pada zaman sekarang, misalnya sebagai penampungan orang miskin atau persinggahan musafir. Istilah hospital (rumah sakit) berasal dari kata Latin, hospes (tuan rumah), yang juga menjadi akar kata hotel dan hospitality (keramahan).\r\n\r\nBeberapa pasien bisa hanya datang untuk diagnosis atau terapi ringan untuk kemudian meminta perawatan jalan, atau bisa pula meminta rawat inap dalam hitungan hari, minggu, atau bulan. Rumah sakit dibedakan dari institusi kesehatan lain dari kemampuannya memberikan diagnosa dan perawatan medis secara menyeluruh kepada pasien.\r\n\r\nRumahsakit menurut WHO Expert Committee On Organization Of Medical Care: is an integral part of social and medical organization, the function of which is to provide for the population complete health care, both curative and preventive and whose out patient service reach out to the family and its home environment; the hospital is also a centre for the training of health workers and for biosocial research', 'publish', 'closed', 'closed', '', 'web-dev', '', '', '2015-02-09 12:49:12', '2015-02-09 05:49:12', '', 0, 'http://localhost/medtech-flanders/?post_type=jobs&#038;p=55', 0, 'jobs', '', 0) ;
